★★★予約販売の注意事項★★★<br><br>

●●お支払い方法につきまして<br>
お支払い方法は、クレジットカード、銀行振込（前払い）、郵便振替（前払い）・コンビニ決済（前払い）の4方法が対象となります。<br>
○クレジットカードご利用の場合・・決済は商品発送時<br>
○銀行振込（前払い）の場合・・注文後、7日以内に入金が確認できない場合は、注文を無効とさせていただきます。<br>
○郵便振替（前払い）の場合・・注文後、7日以内に入金が確認できない場合は、注文を無効とさせていただきます。<br>
○コンビニ決済（前払い）の場合・・注文後、7日以内に入金が確認できない場合は、注文を無効とさせていただきます。<br>
※注意点・・・予約のため、NP後払いはご利用できません。システムの都合上、予約でもNP後払いが選べてしまいますが、予約はNP払いを受け付けておりません。<br><br>


●●同梱につきまして<br>
同じ買い物かごの商品は、商品がすべてそろい次第、まとめて発送させていただきます。<br>
即納の商品や納期の早い予約商品を先に発送希望のお客様は、別々の買い物かごに入れていただくか、備考欄に「即納商品先発送希望」と記載下さい。（送料は別途かかります）<br><br>

●●着日指定につきまして<br>
2月下旬-3月お届け予定ですが、納品日が前後することがございます。<br>
そのため、着日指定はできません。<br>
発送が完了次第、メールにてご連絡させていただきます。<br><br>

●●カラー・デザイン変更につきまして<br>
ブランド意向による商品向上の為仕様変更・カラー変更などがある場合がございます。<br><br>

●●生産停止につきまして<br>
メーカー、工場などの理由から商品化できなくなる場合もございますので、ご了承ください。予約ご注文いただきました後に、生産停止が確定しましたら、ご連絡させていただきます。<br><br>

